sys_variable_value.value:
(function execute(inputs, outputs) {
  //====== Load our Utility library
  var coreUtils = new sn_sp_spoke.SPOUtilsCore();

  //====== Make sure our mandatory inputs are filled. 
  //Runtime does not check if blank value is passed in from a data pill
  var mandatoryInputs = {
    tenant: "Tenant",
    listId: "List ID",
    title: "Title",
    requester: "Requester",
    SN_Request_ID: "SN_Request_ID"
  };
  coreUtils.checkMandatoryInputs(inputs, mandatoryInputs);

  //===== Build our request payload
  // Format
  //
  var requestPayload = {
    'BridgeRole' : inputs.bridgeRole,
    BridgeFacility : inputs.bridgeFacility,
    Comments : inputs.Comments,
    Requester: inputs.requester,
    SN_Request_ID : inputs.SN_Request_ID,
    Requester: inputs.requester,
    Environment: inputs.Environment,
    MillenniumPrimaryPosition : inputs.millenniumPrimaryPosition,
    MillenniumSecondaryPosition : inputs.millenniumSecondaryPosition,
    MillenniumTertiaryPosition : inputs.millenniumTertiaryPosition,
    MillenniumQuaternaryPosition : inputs.millenniumQuaternaryPosition,
    ProvisionActivity: inputs.provisionActivity,
    State : inputs.state,
    Sites : inputs.Site,
    Title: inputs.title,
    VAEmailAddress: inputs.vaEmailAddress,
    VAStation: inputs.vaStation
  };
  if(inputs.customId)
    requestPayload.Id = inputs.customId;

  //===== Then stringify it
  outputs.requestPayload = JSON.stringify(requestPayload);

  //===== handle our site location input parameter.
  outputs.siteLocation = coreUtils.handleURLPath(inputs.siteLocation);
})(inputs, outputs);

