sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.status = "Success";
  var responseBodyObj = {};
  if (inputs.responseBody && inputs.responseBody.indexOf('{') > -1)
    responseBodyObj = JSON.parse(inputs.responseBody);

  var errorHandler = new sn_sp_spoke.SPOErrorHandlerListItemMgmt(inputs.statusCode, responseBodyObj, inputs.responseBody, inputs, 'create');
  if (inputs.errorMessage) {
    outputs.status = "Error";
    var errorObj = errorHandler.getErrorMessage(inputs.customId);
    outputs.errorMessage = errorObj.message;
    outputs.errorDetail = errorObj.detail;
  }

  if (outputs.status == "Success") {
    outputs.relativeURL = responseBodyObj['odata.editLink'];
    outputs.listItemId = responseBodyObj.Id;
  }

})(inputs, outputs);

